import React, {Component} from 'react'
import App from './App'

export default class DisplayList extends Component {

    constructor() {
        super()
    }


    render() {
        return (
            <div>
                {this.App.list.map (item =>
                    <li>{item.name}, {item.type}, {item.exotic} </li>)}
            </div>
        )
    }
}
